<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8" />
<style>body{background-color:white;}</style>
<script>(function() {
  // If window.HTMLWidgets is already defined, then use it; otherwise create a
  // new object. This allows preceding code to set options that affect the
  // initialization process (though none currently exist).
  window.HTMLWidgets = window.HTMLWidgets || {};

  // See if we're running in a viewer pane. If not, we're in a web browser.
  var viewerMode = window.HTMLWidgets.viewerMode =
      /\bviewer_pane=1\b/.test(window.location);

  // See if we're running in Shiny mode. If not, it's a static document.
  // Note that static widgets can appear in both Shiny and static modes, but
  // obviously, Shiny widgets can only appear in Shiny apps/documents.
  var shinyMode = window.HTMLWidgets.shinyMode =
      typeof(window.Shiny) !== "undefined" && !!window.Shiny.outputBindings;

  // We can't count on jQuery being available, so we implement our own
  // version if necessary.
  function querySelectorAll(scope, selector) {
    if (typeof(jQuery) !== "undefined" && scope instanceof jQuery) {
      return scope.find(selector);
    }
    if (scope.querySelectorAll) {
      return scope.querySelectorAll(selector);
    }
  }

  function asArray(value) {
    if (value === null)
      return [];
    if ($.isArray(value))
      return value;
    return [value];
  }

  // Implement jQuery's extend
  function extend(target /*, ... */) {
    if (arguments.length == 1) {
      return target;
    }
    for (var i = 1; i < arguments.length; i++) {
      var source = arguments[i];
      for (var prop in source) {
        if (source.hasOwnProperty(prop)) {
          target[prop] = source[prop];
        }
      }
    }
    return target;
  }

  // IE8 doesn't support Array.forEach.
  function forEach(values, callback, thisArg) {
    if (values.forEach) {
      values.forEach(callback, thisArg);
    } else {
      for (var i = 0; i < values.length; i++) {
        callback.call(thisArg, values[i], i, values);
      }
    }
  }

  // Replaces the specified method with the return value of funcSource.
  //
  // Note that funcSource should not BE the new method, it should be a function
  // that RETURNS the new method. funcSource receives a single argument that is
  // the overridden method, it can be called from the new method. The overridden
  // method can be called like a regular function, it has the target permanently
  // bound to it so "this" will work correctly.
  function overrideMethod(target, methodName, funcSource) {
    var superFunc = target[methodName] || function() {};
    var superFuncBound = function() {
      return superFunc.apply(target, arguments);
    };
    target[methodName] = funcSource(superFuncBound);
  }

  // Add a method to delegator that, when invoked, calls
  // delegatee.methodName. If there is no such method on
  // the delegatee, but there was one on delegator before
  // delegateMethod was called, then the original version
  // is invoked instead.
  // For example:
  //
  // var a = {
  //   method1: function() { console.log('a1'); }
  //   method2: function() { console.log('a2'); }
  // };
  // var b = {
  //   method1: function() { console.log('b1'); }
  // };
  // delegateMethod(a, b, "method1");
  // delegateMethod(a, b, "method2");
  // a.method1();
  // a.method2();
  //
  // The output would be "b1", "a2".
  function delegateMethod(delegator, delegatee, methodName) {
    var inherited = delegator[methodName];
    delegator[methodName] = function() {
      var target = delegatee;
      var method = delegatee[methodName];

      // The method doesn't exist on the delegatee. Instead,
      // call the method on the delegator, if it exists.
      if (!method) {
        target = delegator;
        method = inherited;
      }

      if (method) {
        return method.apply(target, arguments);
      }
    };
  }

  // Implement a vague facsimilie of jQuery's data method
  function elementData(el, name, value) {
    if (arguments.length == 2) {
      return el["htmlwidget_data_" + name];
    } else if (arguments.length == 3) {
      el["htmlwidget_data_" + name] = value;
      return el;
    } else {
      throw new Error("Wrong number of arguments for elementData: " +
        arguments.length);
    }
  }

  // http://stackoverflow.com/questions/3446170/escape-string-for-use-in-javascript-regex
  function escapeRegExp(str) {
    return str.replace(/[\-\[\]\/\{\}\(\)\*\+\?\.\\\^\$\|]/g, "\\$&");
  }

  function hasClass(el, className) {
    var re = new RegExp("\\b" + escapeRegExp(className) + "\\b");
    return re.test(el.className);
  }

  // elements - array (or array-like object) of HTML elements
  // className - class name to test for
  // include - if true, only return elements with given className;
  //   if false, only return elements *without* given className
  function filterByClass(elements, className, include) {
    var results = [];
    for (var i = 0; i < elements.length; i++) {
      if (hasClass(elements[i], className) == include)
        results.push(elements[i]);
    }
    return results;
  }

  function on(obj, eventName, func) {
    if (obj.addEventListener) {
      obj.addEventListener(eventName, func, false);
    } else if (obj.attachEvent) {
      obj.attachEvent(eventName, func);
    }
  }

  function off(obj, eventName, func) {
    if (obj.removeEventListener)
      obj.removeEventListener(eventName, func, false);
    else if (obj.detachEvent) {
      obj.detachEvent(eventName, func);
    }
  }

  // Translate array of values to top/right/bottom/left, as usual with
  // the "padding" CSS property
  // https://developer.mozilla.org/en-US/docs/Web/CSS/padding
  function unpackPadding(value) {
    if (typeof(value) === "number")
      value = [value];
    if (value.length === 1) {
      return {top: value[0], right: value[0], bottom: value[0], left: value[0]};
    }
    if (value.length === 2) {
      return {top: value[0], right: value[1], bottom: value[0], left: value[1]};
    }
    if (value.length === 3) {
      return {top: value[0], right: value[1], bottom: value[2], left: value[1]};
    }
    if (value.length === 4) {
      return {top: value[0], right: value[1], bottom: value[2], left: value[3]};
    }
  }

  // Convert an unpacked padding object to a CSS value
  function paddingToCss(paddingObj) {
    return paddingObj.top + "px " + paddingObj.right + "px " + paddingObj.bottom + "px " + paddingObj.left + "px";
  }

  // Makes a number suitable for CSS
  function px(x) {
    if (typeof(x) === "number")
      return x + "px";
    else
      return x;
  }

  // Retrieves runtime widget sizing information for an element.
  // The return value is either null, or an object with fill, padding,
  // defaultWidth, defaultHeight fields.
  function sizingPolicy(el) {
    var sizingEl = document.querySelector("script[data-for='" + el.id + "'][type='application/htmlwidget-sizing']");
    if (!sizingEl)
      return null;
    var sp = JSON.parse(sizingEl.textContent || sizingEl.text || "{}");
    if (viewerMode) {
      return sp.viewer;
    } else {
      return sp.browser;
    }
  }

  // @param tasks Array of strings (or falsy value, in which case no-op).
  //   Each element must be a valid JavaScript expression that yields a
  //   function. Or, can be an array of objects with "code" and "data"
  //   properties; in this case, the "code" property should be a string
  //   of JS that's an expr that yields a function, and "data" should be
  //   an object that will be added as an additional argument when that
  //   function is called.
  // @param target The object that will be "this" for each function
  //   execution.
  // @param args Array of arguments to be passed to the functions. (The
  //   same arguments will be passed to all functions.)
  function evalAndRun(tasks, target, args) {
    if (tasks) {
      forEach(tasks, function(task) {
        var theseArgs = args;
        if (typeof(task) === "object") {
          theseArgs = theseArgs.concat([task.data]);
          task = task.code;
        }
        var taskFunc = tryEval(task);
        if (typeof(taskFunc) !== "function") {
          throw new Error("Task must be a function! Source:\n" + task);
        }
        taskFunc.apply(target, theseArgs);
      });
    }
  }

  // Attempt eval() both with and without enclosing in parentheses.
  // Note that enclosing coerces a function declaration into
  // an expression that eval() can parse
  // (otherwise, a SyntaxError is thrown)
  function tryEval(code) {
    var result = null;
    try {
      result = eval(code);
    } catch(error) {
      if (!error instanceof SyntaxError) {
        throw error;
      }
      try {
        result = eval("(" + code + ")");
      } catch(e) {
        if (e instanceof SyntaxError) {
          throw error;
        } else {
          throw e;
        }
      }
    }
    return result;
  }

  function initSizing(el) {
    var sizing = sizingPolicy(el);
    if (!sizing)
      return;

    var cel = document.getElementById("htmlwidget_container");
    if (!cel)
      return;

    if (typeof(sizing.padding) !== "undefined") {
      document.body.style.margin = "0";
      document.body.style.padding = paddingToCss(unpackPadding(sizing.padding));
    }

    if (sizing.fill) {
      document.body.style.overflow = "hidden";
      document.body.style.width = "100%";
      document.body.style.height = "100%";
      document.documentElement.style.width = "100%";
      document.documentElement.style.height = "100%";
      if (cel) {
        cel.style.position = "absolute";
        var pad = unpackPadding(sizing.padding);
        cel.style.top = pad.top + "px";
        cel.style.right = pad.right + "px";
        cel.style.bottom = pad.bottom + "px";
        cel.style.left = pad.left + "px";
        el.style.width = "100%";
        el.style.height = "100%";
      }

      return {
        getWidth: function() { return cel.offsetWidth; },
        getHeight: function() { return cel.offsetHeight; }
      };

    } else {
      el.style.width = px(sizing.width);
      el.style.height = px(sizing.height);

      return {
        getWidth: function() { return el.offsetWidth; },
        getHeight: function() { return el.offsetHeight; }
      };
    }
  }

  // Default implementations for methods
  var defaults = {
    find: function(scope) {
      return querySelectorAll(scope, "." + this.name);
    },
    renderError: function(el, err) {
      var $el = $(el);

      this.clearError(el);

      // Add all these error classes, as Shiny does
      var errClass = "shiny-output-error";
      if (err.type !== null) {
        // use the classes of the error condition as CSS class names
        errClass = errClass + " " + $.map(asArray(err.type), function(type) {
          return errClass + "-" + type;
        }).join(" ");
      }
      errClass = errClass + " htmlwidgets-error";

      // Is el inline or block? If inline or inline-block, just display:none it
      // and add an inline error.
      var display = $el.css("display");
      $el.data("restore-display-mode", display);

      if (display === "inline" || display === "inline-block") {
        $el.hide();
        if (err.message !== "") {
          var errorSpan = $("<span>").addClass(errClass);
          errorSpan.text(err.message);
          $el.after(errorSpan);
        }
      } else if (display === "block") {
        // If block, add an error just after the el, set visibility:none on the
        // el, and position the error to be on top of the el.
        // Mark it with a unique ID and CSS class so we can remove it later.
        $el.css("visibility", "hidden");
        if (err.message !== "") {
          var errorDiv = $("<div>").addClass(errClass).css("position", "absolute")
            .css("top", el.offsetTop)
            .css("left", el.offsetLeft)
            // setting width can push out the page size, forcing otherwise
            // unnecessary scrollbars to appear and making it impossible for
            // the element to shrink; so use max-width instead
            .css("maxWidth", el.offsetWidth)
            .css("height", el.offsetHeight);
          errorDiv.text(err.message);
          $el.after(errorDiv);

          // Really dumb way to keep the size/position of the error in sync with
          // the parent element as the window is resized or whatever.
          var intId = setInterval(function() {
            if (!errorDiv[0].parentElement) {
              clearInterval(intId);
              return;
            }
            errorDiv
              .css("top", el.offsetTop)
              .css("left", el.offsetLeft)
              .css("maxWidth", el.offsetWidth)
              .css("height", el.offsetHeight);
          }, 500);
        }
      }
    },
    clearError: function(el) {
      var $el = $(el);
      var display = $el.data("restore-display-mode");
      $el.data("restore-display-mode", null);

      if (display === "inline" || display === "inline-block") {
        if (display)
          $el.css("display", display);
        $(el.nextSibling).filter(".htmlwidgets-error").remove();
      } else if (display === "block"){
        $el.css("visibility", "inherit");
        $(el.nextSibling).filter(".htmlwidgets-error").remove();
      }
    },
    sizing: {}
  };

  // Called by widget bindings to register a new type of widget. The definition
  // object can contain the following properties:
  // - name (required) - A string indicating the binding name, which will be
  //   used by default as the CSS classname to look for.
  // - initialize (optional) - A function(el) that will be called once per
  //   widget element; if a value is returned, it will be passed as the third
  //   value to renderValue.
  // - renderValue (required) - A function(el, data, initValue) that will be
  //   called with data. Static contexts will cause this to be called once per
  //   element; Shiny apps will cause this to be called multiple times per
  //   element, as the data changes.
  window.HTMLWidgets.widget = function(definition) {
    if (!definition.name) {
      throw new Error("Widget must have a name");
    }
    if (!definition.type) {
      throw new Error("Widget must have a type");
    }
    // Currently we only support output widgets
    if (definition.type !== "output") {
      throw new Error("Unrecognized widget type '" + definition.type + "'");
    }
    // TODO: Verify that .name is a valid CSS classname

    // Support new-style instance-bound definitions. Old-style class-bound
    // definitions have one widget "object" per widget per type/class of
    // widget; the renderValue and resize methods on such widget objects
    // take el and instance arguments, because the widget object can't
    // store them. New-style instance-bound definitions have one widget
    // object per widget instance; the definition that's passed in doesn't
    // provide renderValue or resize methods at all, just the single method
    //   factory(el, width, height)
    // which returns an object that has renderValue(x) and resize(w, h).
    // This enables a far more natural programming style for the widget
    // author, who can store per-instance state using either OO-style
    // instance fields or functional-style closure variables (I guess this
    // is in contrast to what can only be called C-style pseudo-OO which is
    // what we required before).
    if (definition.factory) {
      definition = createLegacyDefinitionAdapter(definition);
    }

    if (!definition.renderValue) {
      throw new Error("Widget must have a renderValue function");
    }

    // For static rendering (non-Shiny), use a simple widget registration
    // scheme. We also use this scheme for Shiny apps/documents that also
    // contain static widgets.
    window.HTMLWidgets.widgets = window.HTMLWidgets.widgets || [];
    // Merge defaults into the definition; don't mutate the original definition.
    var staticBinding = extend({}, defaults, definition);
    overrideMethod(staticBinding, "find", function(superfunc) {
      return function(scope) {
        var results = superfunc(scope);
        // Filter out Shiny outputs, we only want the static kind
        return filterByClass(results, "html-widget-output", false);
      };
    });
    window.HTMLWidgets.widgets.push(staticBinding);

    if (shinyMode) {
      // Shiny is running. Register the definition with an output binding.
      // The definition itself will not be the output binding, instead
      // we will make an output binding object that delegates to the
      // definition. This is because we foolishly used the same method
      // name (renderValue) for htmlwidgets definition and Shiny bindings
      // but they actually have quite different semantics (the Shiny
      // bindings receive data that includes lots of metadata that it
      // strips off before calling htmlwidgets renderValue). We can't
      // just ignore the difference because in some widgets it's helpful
      // to call this.renderValue() from inside of resize(), and if
      // we're not delegating, then that call will go to the Shiny
      // version instead of the htmlwidgets version.

      // Merge defaults with definition, without mutating either.
      var bindingDef = extend({}, defaults, definition);

      // This object will be our actual Shiny binding.
      var shinyBinding = new Shiny.OutputBinding();

      // With a few exceptions, we'll want to simply use the bindingDef's
      // version of methods if they are available, otherwise fall back to
      // Shiny's defaults. NOTE: If Shiny's output bindings gain additional
      // methods in the future, and we want them to be overrideable by
      // HTMLWidget binding definitions, then we'll need to add them to this
      // list.
      delegateMethod(shinyBinding, bindingDef, "getId");
      delegateMethod(shinyBinding, bindingDef, "onValueChange");
      delegateMethod(shinyBinding, bindingDef, "onValueError");
      delegateMethod(shinyBinding, bindingDef, "renderError");
      delegateMethod(shinyBinding, bindingDef, "clearError");
      delegateMethod(shinyBinding, bindingDef, "showProgress");

      // The find, renderValue, and resize are handled differently, because we
      // want to actually decorate the behavior of the bindingDef methods.

      shinyBinding.find = function(scope) {
        var results = bindingDef.find(scope);

        // Only return elements that are Shiny outputs, not static ones
        var dynamicResults = results.filter(".html-widget-output");

        // It's possible that whatever caused Shiny to think there might be
        // new dynamic outputs, also caused there to be new static outputs.
        // Since there might be lots of different htmlwidgets bindings, we
        // schedule execution for later--no need to staticRender multiple
        // times.
        if (results.length !== dynamicResults.length)
          scheduleStaticRender();

        return dynamicResults;
      };

      // Wrap renderValue to handle initialization, which unfortunately isn't
      // supported natively by Shiny at the time of this writing.

      shinyBinding.renderValue = function(el, data) {
        Shiny.renderDependencies(data.deps);
        // Resolve strings marked as javascript literals to objects
        if (!(data.evals instanceof Array)) data.evals = [data.evals];
        for (var i = 0; data.evals && i < data.evals.length; i++) {
          window.HTMLWidgets.evaluateStringMember(data.x, data.evals[i]);
        }
        if (!bindingDef.renderOnNullValue) {
          if (data.x === null) {
            el.style.visibility = "hidden";
            return;
          } else {
            el.style.visibility = "inherit";
          }
        }
        if (!elementData(el, "initialized")) {
          initSizing(el);

          elementData(el, "initialized", true);
          if (bindingDef.initialize) {
            var result = bindingDef.initialize(el, el.offsetWidth,
              el.offsetHeight);
            elementData(el, "init_result", result);
          }
        }
        bindingDef.renderValue(el, data.x, elementData(el, "init_result"));
        evalAndRun(data.jsHooks.render, elementData(el, "init_result"), [el, data.x]);
      };

      // Only override resize if bindingDef implements it
      if (bindingDef.resize) {
        shinyBinding.resize = function(el, width, height) {
          // Shiny can call resize before initialize/renderValue have been
          // called, which doesn't make sense for widgets.
          if (elementData(el, "initialized")) {
            bindingDef.resize(el, width, height, elementData(el, "init_result"));
          }
        };
      }

      Shiny.outputBindings.register(shinyBinding, bindingDef.name);
    }
  };

  var scheduleStaticRenderTimerId = null;
  function scheduleStaticRender() {
    if (!scheduleStaticRenderTimerId) {
      scheduleStaticRenderTimerId = setTimeout(function() {
        scheduleStaticRenderTimerId = null;
        window.HTMLWidgets.staticRender();
      }, 1);
    }
  }

  // Render static widgets after the document finishes loading
  // Statically render all elements that are of this widget's class
  window.HTMLWidgets.staticRender = function() {
    var bindings = window.HTMLWidgets.widgets || [];
    forEach(bindings, function(binding) {
      var matches = binding.find(document.documentElement);
      forEach(matches, function(el) {
        var sizeObj = initSizing(el, binding);

        if (hasClass(el, "html-widget-static-bound"))
          return;
        el.className = el.className + " html-widget-static-bound";

        var initResult;
        if (binding.initialize) {
          initResult = binding.initialize(el,
            sizeObj ? sizeObj.getWidth() : el.offsetWidth,
            sizeObj ? sizeObj.getHeight() : el.offsetHeight
          );
          elementData(el, "init_result", initResult);
        }

        if (binding.resize) {
          var lastSize = {
            w: sizeObj ? sizeObj.getWidth() : el.offsetWidth,
            h: sizeObj ? sizeObj.getHeight() : el.offsetHeight
          };
          var resizeHandler = function(e) {
            var size = {
              w: sizeObj ? sizeObj.getWidth() : el.offsetWidth,
              h: sizeObj ? sizeObj.getHeight() : el.offsetHeight
            };
            if (size.w === 0 && size.h === 0)
              return;
            if (size.w === lastSize.w && size.h === lastSize.h)
              return;
            lastSize = size;
            binding.resize(el, size.w, size.h, initResult);
          };

          on(window, "resize", resizeHandler);

          // This is needed for cases where we're running in a Shiny
          // app, but the widget itself is not a Shiny output, but
          // rather a simple static widget. One example of this is
          // an rmarkdown document that has runtime:shiny and widget
          // that isn't in a render function. Shiny only knows to
          // call resize handlers for Shiny outputs, not for static
          // widgets, so we do it ourselves.
          if (window.jQuery) {
            window.jQuery(document).on(
              "shown.htmlwidgets shown.bs.tab.htmlwidgets shown.bs.collapse.htmlwidgets",
              resizeHandler
            );
            window.jQuery(document).on(
              "hidden.htmlwidgets hidden.bs.tab.htmlwidgets hidden.bs.collapse.htmlwidgets",
              resizeHandler
            );
          }

          // This is needed for the specific case of ioslides, which
          // flips slides between display:none and display:block.
          // Ideally we would not have to have ioslide-specific code
          // here, but rather have ioslides raise a generic event,
          // but the rmarkdown package just went to CRAN so the
          // window to getting that fixed may be long.
          if (window.addEventListener) {
            // It's OK to limit this to window.addEventListener
            // browsers because ioslides itself only supports
            // such browsers.
            on(document, "slideenter", resizeHandler);
            on(document, "slideleave", resizeHandler);
          }
        }

        var scriptData = document.querySelector("script[data-for='" + el.id + "'][type='application/json']");
        if (scriptData) {
          var data = JSON.parse(scriptData.textContent || scriptData.text);
          // Resolve strings marked as javascript literals to objects
          if (!(data.evals instanceof Array)) data.evals = [data.evals];
          for (var k = 0; data.evals && k < data.evals.length; k++) {
            window.HTMLWidgets.evaluateStringMember(data.x, data.evals[k]);
          }
          binding.renderValue(el, data.x, initResult);
          evalAndRun(data.jsHooks.render, initResult, [el, data.x]);
        }
      });
    });

    invokePostRenderHandlers();
  }


  function has_jQuery3() {
    if (!window.jQuery) {
      return false;
    }
    var $version = window.jQuery.fn.jquery;
    var $major_version = parseInt($version.split(".")[0]);
    return $major_version >= 3;
  }

  /*
  / Shiny 1.4 bumped jQuery from 1.x to 3.x which means jQuery's
  / on-ready handler (i.e., $(fn)) is now asyncronous (i.e., it now
  / really means $(setTimeout(fn)).
  / https://jquery.com/upgrade-guide/3.0/#breaking-change-document-ready-handlers-are-now-asynchronous
  /
  / Since Shiny uses $() to schedule initShiny, shiny>=1.4 calls initShiny
  / one tick later than it did before, which means staticRender() is
  / called renderValue() earlier than (advanced) widget authors might be expecting.
  / https://github.com/rstudio/shiny/issues/2630
  /
  / For a concrete example, leaflet has some methods (e.g., updateBounds)
  / which reference Shiny methods registered in initShiny (e.g., setInputValue).
  / Since leaflet is privy to this life-cycle, it knows to use setTimeout() to
  / delay execution of those methods (until Shiny methods are ready)
  / https://github.com/rstudio/leaflet/blob/18ec981/javascript/src/index.js#L266-L268
  /
  / Ideally widget authors wouldn't need to use this setTimeout() hack that
  / leaflet uses to call Shiny methods on a staticRender(). In the long run,
  / the logic initShiny should be broken up so that method registration happens
  / right away, but binding happens later.
  */
  function maybeStaticRenderLater() {
    if (shinyMode && has_jQuery3()) {
      window.jQuery(window.HTMLWidgets.staticRender);
    } else {
      window.HTMLWidgets.staticRender();
    }
  }

  if (document.addEventListener) {
    document.addEventListener("DOMContentLoaded", function() {
      document.removeEventListener("DOMContentLoaded", arguments.callee, false);
      maybeStaticRenderLater();
    }, false);
  } else if (document.attachEvent) {
    document.attachEvent("onreadystatechange", function() {
      if (document.readyState === "complete") {
        document.detachEvent("onreadystatechange", arguments.callee);
        maybeStaticRenderLater();
      }
    });
  }

ttribute('y') < minimumY) {\n        minimumY = +this.getAttribute('y');\n      }\n      if (+this.getAttribute('y') > maximumY) {\n        maximumY = +this.getAttribute('y');\n      }\n    });\n\n  FD.append(\"line\")\n    .attr(\"class\", \"interceptLine\")\n    .attr(\"x1\", x(0))\n    .attr(\"y1\", minimumY)\n    .attr(\"x2\", x(0))\n    .attr(\"y2\", maximumY + y.bandwidth());\n\n  FD.append(\"text\")\n    .attr(\"transform\",\n          \"translate(\" + (margin.left + fdPlotWidth/2) + \",\" +\n                         (margin.top + fdPlotHeight + 45) + \")\")\n    .attr(\"class\", \"axisTitle\")\n    .attr(\"text-anchor\", \"middle\")\n    .text(\"count\");\n}\n\nfunction tvNumericalPlot(variableName, xData, xMinMax, yMinMax) {\n\n  var tvPlotHeight = h,\n      tvPlotWidth = w;\n\n  var x = d3.scaleLinear()\n            .range([margin.left + 10, margin.left + tvPlotWidth - 10])\n            .domain(xMinMax);\n\n  TV.append(\"text\")\n    .attr(\"transform\",\n          \"translate(\" + (margin.left + tvPlotWidth/2) + \" ,\" +\n                         (margin.top + tvPlotHeight + 45) + \")\")\n    .attr(\"class\", \"axisTitle\")\n    .attr(\"text-anchor\", \"middle\")\n    .text(variableName);\n\n  var y = d3.scaleLinear()\n            .range([margin.top + tvPlotHeight, margin.top - additionalHeight])\n            .domain(yMinMax);\n\n  TV.append(\"text\")\n    .attr(\"class\",\"smallTitle\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 15)\n    .text(tvSubtitle);\n\n  TV.append(\"text\")\n    .attr(\"class\", \"bigTitle\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 40)\n    .text(tvTitle);\n\n  // find 5 nice ticks with max and min - do better than d3\n  var tickValues = getTickValues(x.domain());\n\n  var xAxis = d3.axisBottom(x)\n                .tickValues(tickValues)\n                .tickSizeInner(0)\n                .tickPadding(15);\n\n  xAxis = TV.append(\"g\")\n            .attr(\"class\", \"axisLabel\")\n  y = d3.scaleBand()\n            .rangeRound([margin.top - additionalHeight, margin.top + tvPlotHeight])\n            .padding(0.33)\n            .domain(xMinMax);\n\n  var xGrid = TV.append(\"g\")\n                .attr(\"class\", \"grid\")\n                .attr(\"transform\", \"translate(0,\" + (margin.top + tvPlotHeight) + \")\")\n                .call(d3.axisBottom(x)\n                        .ticks(10)\n                        .tickSize(-tvPlotHeight - additionalHeight)\n                        .tickFormat(\"\")\n                ).call(g => g.select(\".domain\").remove());\n\n  var yGrid = TV.append(\"g\")\n                .attr(\"class\", \"grid\")\n                .attr(\"transform\", \"translate(\" + margin.left + \",0)\")\n                .call(d3.axisLeft(y)\n                        .tickSize(-tvPlotWidth)\n                        .tickFormat(\"\")\n                ).call(g => g.select(\".domain\").remove());\n\n  var yAxis = d3.axisLeft(y)\n                .tickSize(0);\n\n  yAxis = TV.append(\"g\")\n            .attr(\"class\", \"axisLabel\")\n            .attr(\"transform\",\"translate(\" + (margin.left - 10) + \",0)\")\n            .call(yAxis)\n            .call(g => g.select(\".domain\").remove());\n\n  yAxis.selectAll(\"text\").call(wrapText, margin.left - 15);\n\n  TV.append(\"text\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 15)\n    .attr(\"class\", \"smallTitle\")\n    .text(tvSubtitle);\n\n  TV.append(\"text\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 40)\n    .attr(\"class\", \"bigTitle\")\n    .text(tvTitle);\n\n  TV.append(\"text\")\n    .attr(\"transform\",\n          \"translate(\" + (margin.left + tvPlotWidth/2) + \" ,\" +\n                         (margin.top + tvPlotHeight + 45) + \")\")\n    .attr(\"class\", \"axisTitle\")\n    .attr(\"text-anchor\", \"middle\")\n    .text(\"target\");\n\n  TV.selectAll()\n    .data(xData)\n    .enter()\n    .append(\"circle\")\n    .attr(\"class\", \"point\")\n    .attr(\"cx\", d => x(d[\"_target_\"]))\n    .attr(\"cy\", d => y(d[variableName]) + y.bandwidth()\n    - (0.1 + 0.8*Math.random()) * y.bandwidth())\n    .attr(\"r\", 0)\n    .style(\"fill\", tvPointColor)\n    .transition()\n    .duration(TIME)\n    .attr(\"r\", tvPointSize);\n}\n\nfunction atNumericalPlot(variableName, xData, xMinMax, yMinMax, yMean) {\n\n  var atPlotHeight = h,\n      atPlotWidth = w;\n\n  var x = d3.scaleLinear()\n            .range([margin.left + 10, margin.left + atPlotWidth - 10])\n            .domain(xMinMax);\n\n  AT.append(\"text\")\n    .attr(\"transform\",\n          \"translate(\" + (margin.left + atPlotWidth/2) + \" ,\" +\n                         (margin.top + atPlotHeight + 45) + \")\")\n    .attr(\"class\", \"axisTitle\")\n    .attr(\"text-anchor\", \"middle\")\n    .text(variableName);\n\n  var y = d3.scaleLinear()\n            .range([margin.top + atPlotHeight, margin.top - additionalHeight])\n            .domain(yMinMax);\n\n  AT.append(\"text\")\n    .attr(\"class\",\"smallTitle\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 15)\n    .text(atSubtitle);\n\n  AT.append(\"text\")\n    .attr(\"class\", \"bigTitle\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 40)\n    .text(atTitle);\n\n  // find 5 nice ticks with max and min - do better than d3\n  var tickValues = getTickValues(x.domain());\n\n  var xAxis = d3.axisBottom(x)\n                .tickValues(tickValues)\n                .tickSizeInner(0)\n                .tickPadding(15);\n\n  xAxis = AT.append(\"g\")\n            .attr(\"class\", \"axisLabel\")\n            .attr(\"transform\", \"translate(0,\"+ (margin.top + atPlotHeight) + \")\")\n            .call(xAxis);\n\n  var yGrid = AT.append(\"g\")\n                .attr(\"class\", \"grid\")\n                .attr(\"transform\", \"translate(\" + margin.left + \",0)\")\n                .call(d3.axisLeft(y)\n                        .ticks(10)\n                        .tickSize(-atPlotWidth)\n                        .tickFormat(\"\")\n                ).call(g => g.select(\".domain\").remove());\n\n  var yAxis = d3.axisLeft(y)\n                .ticks(5)\n                .tickSize(0);\n\n  yAxis = AT.append(\"g\")\n            .attr(\"class\", \"axisLabel\")\n            .attr(\"transform\",\"translate(\" + margin.left + \",0)\")\n            .call(yAxis)\n            .call(g => g.select(\".domain\").remove());\n\n  AT.append(\"text\")\n    .attr(\"class\", \"axisTitle\")\n    .attr(\"transform\", \"rotate(-90)\")\n    .attr(\"y\", margin.left - margin.ytitle)\n    .attr(\"x\", -(margin.top + atPlotHeight/2))\n    .attr(\"text-anchor\", \"middle\")\n    .text(\"average target\");\n\n  AT.append(\"line\")\n    .attr(\"class\", \"interceptLine\")\n    .attr(\"x1\", x(x.domain()[0]))\n    .attr(\"y1\", y(yMean))\n    .attr(\"x2\", x(x.domain()[1]))\n    .attr(\"y2\", y(yMean));\n\n  var lines = AT.selectAll()\n                .data(xData)\n                .enter()\n                .append(\"g\");\n\n  lines.append(\"line\")\n       .style(\"stroke\", atLineColor)\n       .style(\"stroke-width\", atLineSize)\n       .attr(\"x1\", d => x(d.x0))\n       .attr(\"x2\", d => x(d.x0))\n       .attr(\"y1\", d => y(d.y0))\n       .attr(\"y2\", d => y(d.y0))\n       .transition()\n       .duration(TIME/2)\n       .delay((d,i) => (i+1) * TIME/2)\n       .attr(\"x2\", d => x(d.x1))\n       .attr(\"y2\", d => y(d.y1))\n\n  lines.append(\"circle\")\n       .attr(\"cx\", d => x(d.x0))\n       .attr(\"cy\", d => y(d.y0))\n       .attr(\"r\", 0)\n       .style(\"fill\", atPointColor)\n       .transition()\n       .duration(TIME/2)\n       .delay((d,i) => i * TIME/2)\n       .attr(\"r\", atPointSize);\n\n  let lastPoint = xData.slice(-1)[0]\n\n  AT.append(\"circle\")\n    .attr(\"cx\", x(lastPoint.x1))\n    .attr(\"cy\", y(lastPoint.y1))\n    .attr(\"r\", 0)\n    .style(\"fill\", atPointColor)\n    .transition()\n    .duration(TIME/2)\n    .delay(xData.length * TIME/2)\n    .attr(\"r\", atPointSize);\n}\n\nfunction atCategoricalPlot(variableName, xData, xMinMax, yMinMax, yMean) {\n\n  var atBarCount = xData.length;\n\n  var atPlotHeight = SCALE_PLOT ? h : atBarCount*atBarWidth + (atBarCount+1)*atBarWidth/2,\n      atPlotWidth = w;\n\n  var x = d3.scaleLinear()\n            .range([margin.left, margin.left + atPlotWidth])\n            .domain(yMinMax);\n\n  var xAxis = d3.axisBottom(x)\n                .ticks(5)\n                .tickSize(0);\n\n  xAxis = AT.append(\"g\")\n            .attr(\"class\", \"axisLabel\")\n            .attr(\"transform\", \"translate(0,\" + (margin.top + atPlotHeight) + \")\")\n            .call(xAxis)\n            .call(g => g.select(\".domain\").remove());\n\n  var y = d3.scaleBand()\n            .rangeRound([margin.top - additionalHeight, margin.top + atPlotHeight])\n            .padding(0.33)\n            .domain(xMinMax);\n\n  var xGrid = AT.append(\"g\")\n                .attr(\"class\", \"grid\")\n                .attr(\"transform\", \"translate(0,\" + (margin.top + atPlotHeight) + \")\")\n                .call(d3.axisBottom(x)\n                        .ticks(10)\n                        .tickSize(-atPlotHeight - additionalHeight)\n                        .tickFormat(\"\")\n                ).call(g => g.select(\".domain\").remove());\n\n  var yGrid = AT.append(\"g\")\n                .attr(\"class\", \"grid\")\n                .attr(\"transform\", \"translate(\" + margin.left + \",0)\")\n                .call(d3.axisLeft(y)\n                        .tickSize(-atPlotWidth)\n                        .tickFormat(\"\")\n                ).call(g => g.select(\".domain\").remove());\n\n  var yAxis = d3.axisLeft(y)\n                .tickSize(0);\n\n  yAxis = AT.append(\"g\")\n            .attr(\"class\", \"axisLabel\")\n            .attr(\"transform\",\"translate(\" + (margin.left - 10) + \",0)\")\n            .call(yAxis)\n            .call(g => g.select(\".domain\").remove());\n\n  yAxis.selectAll(\"text\").call(wrapText, margin.left - 15);\n\n  AT.append(\"text\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 15)\n    .attr(\"class\", \"smallTitle\")\n    .text(atSubtitle);\n\n  AT.append(\"text\")\n    .attr(\"x\", margin.left)\n    .attr(\"y\", margin.top - 40)\n    .attr(\"class\", \"bigTitle\")\n    .text(atTitle);\n\n  AT.append(\"text\")\n    .attr(\"transform\",\n          \"translate(\" + (margin.left + atPlotWidth/2) + \" ,\" +\n                         (margin.top + atPlotHeight + 45) + \")\")\n    .attr(\"class\", \"axisTitle\")\n    .attr(\"text-anchor\", \"middle\")\n    .text(\"average target\");\n\n  var bars = AT.selectAll()\n               .data(xData)\n               .enter()\n               .append(\"g\");\n\n  bars.append(\"rect\")\n      .attr(\"class\", \"AT-bars\")\n      .attr(\"fill\", atBarColor)\n      .attr(\"x\", d => x(yMean))\n      .attr(\"y\", d => y(d.y))\n      .attr(\"height\", y.bandwidth())\n      .transition()\n      .duration(TIME)\n      .delay((d,i) => i * TIME)\n      .attr(\"x\", d => d.sign == 1 ? x(yMean) : x(d.x0))\n      .attr(\"width\", d => Math.abs(x(d.x0) - x(yMean)));\n\n  // add intercept line\n  var minimumY = Number.MAX_VALUE;\n  var maximumY = Number.MIN_VALUE;\n\n  bars.selectAll(\".AT-bars\").each(function() {\n      if (+this.getAttribute('y') < minimumY) {\n        minimumY = +this.getAttribute('y');\n      }\n      if (+this.getAttribute('y') > maximumY) {\n        maximumY = +this.getAttribute('y');\n      }\n    });\n\n  AT.append(\"line\")\n    .attr(\"class\", \"interceptLine\")\n    .attr(\"x1\", x(yMean))\n    .attr(\"y1\", minimumY)\n    .attr(\"x2\", x(yMean))\n    .attr(\"y2\", maximumY + y.bandwidth());\n}\n\n/// event plot functions\n\nfunction updatePlots(event, variableName, observationId, plotId) {\n  /// main plot controller, not used arguments are passed as null\n\n  switch (event) {\n    case \"observationChange\":\n      CLICKED_OBSERVATION_ID = observationId;\n      removePlots([\"BD\", \"SV\", \"CP\"]);\n      generatePlots([\"BD\", \"SV\", \"CP\"]);\n      break;\n\n    case \"variableChange\":\n      // safeguard\n      if (variableName == \"prediction\" || variableName == \"intercept\" ||\n          variableName == \"other\") { return; }\n      CLICKED_VARIABLE_NAME = variableName;\n      removePlots([\"CP\", \"PD\", \"AD\", \"FD\", \"TV\", \"AT\"]);\n      generatePlots([\"CP\", \"PD\", \"AD\", \"FD\", \"TV\", \"AT\"]);\n      break;\n\n    case \"chosePlot\":\n      removePlots([plotId]);\n      generatePlots([plotId]);\n      break;\n\n    default:\n      console.log(\"Unknown event in updatePlots \" +\n                  [event,variableName, observationId, plotId]);\n      break;\n  }\n}\n\nfunction removePlots(arrPlotId) {\n  /// check if there is something to delete and get rid of it (with tooltip)\n  arrPlotId.forEach((id) => {\n    if (!svg.select(\"#\"+id).selectAll(\"*\").empty()) {\n      svg.select(\"#\"+id).selectAll(\"*\").remove();\n      d3.select(\"body\").select(\"#tooltip\"+id).remove();\n    }\n  });\n}\n\nfunction generatePlots(arrPlotId) {\n  /// check if the plot got removed and make new one\n  arrPlotId.forEach((id) => {\n    if (svg.select(\"#\"+id).selectAll(\"*\").empty()) {\n      // execute plot function\n      mapIdPlotFunction[id]();\n    }\n  });\n}\n\n/* R2D3 Source File:   */\n//:\\\\\\ here are functions for tooltips HTML //:\\\\\\\n\nfunction bdTooltipHtml(d) {\n  var temp = \"<center>\";\n  temp += d.tooltipText;\n  temp += \"<\/center>\";\n  return temp;\n}\n\nfunction cpStaticTooltipHtml(d) {\n  // function formats tooltip text\n  var temp = \"\";\n  for (var [k, v] of Object.entries(d)) {\n    if (k === \"yhat\") {\n      k = \"prediction\";\n      temp += \"<center>\" +  k + \": \" + v + \"<\/br>\";\n      temp += \"<\/br>\";\n    } else {\n      temp += \"<center>\" +  k + \": \" + v + \"<\/br>\";\n    }\n  }\n  return temp;\n}\n\nfunction cpChangedTooltipHtml(d, addData) {\n  // function formats tooltip text with update in red\n  var temp = \"<center>\";\n  for (var [k, v] of Object.entries(addData)) {\n    if (k === \"yhat\") {\n      temp += \"prediction:<\/br>\";\n      temp += \"- before\" + \": \" + v + \"<\/br>\";\n      temp += \"- after\" + \": \" + \"<font color = \\\"red\\\">\" + d.yhat + \"<\/br><\/font>\";\n      temp += \"<\/br>\";\n    } else if (k === d.vname) {\n      temp +=  k + \": \" + \"<font color = \\\"red\\\">\"  +  d.xhat + \"<\/br><\/font>\";\n    } else {\n      temp += k + \": \" + v + \"<\/br>\";\n    }\n  }\n  temp += \"<\/center>\";\n  return temp;\n}\n\nfunction fiStaticTooltipHtml(d) {\n    let sign;\n    if (d.dropout_loss > d.full_model) sign = \"+\"; else sign = \"\";\n    var temp =  \"<center>\" + \"model loss after feature \" + d.variable\n      + \"<\/br>\" + \"<center>\" +\n      \" is permuted: \" +  Math.round(d.dropout_loss * 1000)/1000\n      + \"<\/br>\" + \"<center>\" + \"drop-out loss change: \" +\n      sign + Math.round((d.dropout_loss-d.full_model)*1000)/1000;\n    return temp;\n}\n\nfunction pdStaticTooltipHtml(d, variableName, yMean) {\n  // function formats tooltip text\n  var temp = \"\";\n  for (var [k, v] of Object.entries(d)) {\n    switch(k){\n      case \"xhat\":\n        temp += \"<center>\" +  variableName  + \": \" + v + \"<\/br>\";\n        break;\n      case \"yhat\":\n        temp += \"<center>\" +  \"average prediction\"  + \": \" + v + \"<\/br>\";\n        break;\n      case \"vname\":\n        break;\n      default:\n        temp += \"<center>\" +  k  + \": \" + v + \"<\/br>\";\n        break;\n    }\n  }\n\n  temp += \"<\/br><center>\" +\n          \"mean observation prediction:\" +\n          \"<\/br>\" + yMean + \"<\/br>\";\n  return temp;\n}\n\nfunction adStaticTooltipHtml(d, variableName, yMean) {\n  // function formats tooltip text\n  var temp = \"\";\n  for (var [k, v] of Object.entries(d)) {\n    switch(k){\n      case \"xhat\":\n        temp += \"<center>\" +  variableName  + \": \" + v + \"<\/br>\";\n        break;\n      case \"yhat\":\n        temp += \"<center>\" +  \"accumulated prediction\"  + \": \" + v + \"<\/br>\";\n        break;\n      case \"vname\":\n        break;\n      default:\n        temp += \"<center>\" +  k  + \": \" + v + \"<\/br>\";\n        break;\n    }\n  }\n\n  temp += \"<\/br><center>\" +\n          \"mean observation prediction:\" +\n          \"<\/br>\" + yMean + \"<\/br>\";\n  return temp;\n}\n\nfunction descTooltipHtml(d) {\n  var temp = \"<center>\";\n  temp += d.text;\n  temp += \"<\/center>\";\n  return temp;\n}\nsvg = d3.select(svg.node());\n/* R2D3 Source File:   */\n///:\\\\\\ --------- main modelStudio file --------- ///:\\\\\\\n///:\\\\\\ (for myself to remember):                 ///:\\\\\\\n///:\\\\\\ use CAPITAL for global variables and 'g'  ///:\\\\\\\n///:\\\\\\ use let where possible                    ///:\\\\\\\n///:\\\\\\ use class for css and id for select       ///:\\\\\\\n///:\\\\\\ use lambdas and ifelse where possible     ///:\\\\\\\n///:\\\\\\ ----------------------------------------- ///:\\\\\\\n\n/// prevent modelStudio from reloading onResize\nr2d3.onResize(function() {\n  return;\n});\n\n/// load all data\nvar obsData = data[0],\n    fiData = data[1], pdData = data[2],\n    adData = data[3], fdData = data[4],\n    tvData = data[4], atData = data[5];\n\n/// load options\nvar TIME = options.time,\n    modelName = options.model_name,\n    variableNames = options.variable_names,\n    dim = options.facet_dim,\n    footerText = options.footer_text,\n    dropDownData = options.drop_down_data,\n    EDA = options.eda,\n    WIDGET_ID = options.widget_id,\n    SCALE_PLOT = options.scale_plot,\n    SHOW_BOXPLOT = options.show_boxplot,\n    SHOW_SUBTITLE = options.show_subtitle,\n    subTitle = options.subtitle || modelName,\n    msTitle = options.ms_title,\n    barWidth = options.bar_width,\n    lineSize = options.line_size,\n    pointSize = options.point_size,\n    barColor = options.bar_color,\n    lineColor = options.line_color,\n    pointColor = options.point_color,\n    positiveColor = options.positive_color,\n    negativeColor = options.negative_color,\n    defaultColor = options.default_color,\n    bdTitle = options.bd_title,\n    bdSubtitle = options.bd_subtitle || subTitle,\n    bdBarWidth = options.bd_bar_width || barWidth,\n    bdPositiveColor = options.bd_positive_color || positiveColor,\n    bdNegativeColor = options.bd_negative_color || negativeColor,\n    bdDefaultColor = options.bd_default_color || defaultColor,\n    svTitle = options.sv_title,\n    svSubtitle = options.sv_subtitle || subTitle,\n    svBarWidth = options.sv_bar_width || barWidth,\n    svPositiveColor = options.sv_positive_color || positiveColor,\n    svNegativeColor = options.sv_negative_color || negativeColor,\n    cpTitle = options.cp_title,\n    cpSubtitle = options.cp_subtitle || subTitle,\n    cpBarWidth = options.cp_bar_width || barWidth,\n    cpLineSize = options.cp_line_size || lineSize,\n    cpPointSize = options.cp_point_size || pointSize,\n    cpBarColor = options.cp_bar_color || barColor,\n    cpLineColor = options.cp_line_color || lineColor,\n    cpPointColor = options.cp_point_color || pointColor,\n    fiTitle = options.fi_title,\n    fiSubtitle = options.fi_subtitle || subTitle,\n    fiBarWidth = options.fi_bar_width || barWidth,\n    fiBarColor = options.fi_bar_color || barColor,\n    pdTitle = options.pd_title,\n    pdSubtitle = options.pd_subtitle || subTitle,\n    pdBarWidth = options.pd_bar_width || barWidth,\n    pdLineSize = options.pd_line_size || lineSize,\n    pdBarColor = options.pd_bar_color || barColor,\n    pdLineColor = options.pd_line_color || lineColor,\n    adTitle = options.ad_title,\n    adSubtitle = options.ad_subtitle || subTitle,\n    adBarWidth = options.ad_bar_width || barWidth,\n    adLineSize = options.ad_line_size || lineSize,\n    adBarColor = options.ad_bar_color || barColor,\n    adLineColor = options.ad_line_color || lineColor,\n    fdTitle = options.fd_title,\n    fdSubtitle = options.fd_subtitle || subTitle,\n    fdBarWidth = options.fd_bar_width || barWidth,\n    fdBarColor = options.fd_bar_color || barColor,\n    tvTitle = options.tv_title,\n    tvSubtitle = options.tv_subtitle || subTitle,\n    tvPointSize = options.tv_point_size || pointSize,\n    tvPointColor = options.tv_point_color || pointColor,\n    atTitle = options.at_title,\n    atSubtitle = options.at_subtitle || subTitle,\n    atBarWidth = options.at_bar_width || barWidth,\n    atLineSize = options.at_line_size || lineSize,\n    atPointSize = options.at_point_size || pointSize,\n    atBarColor = options.at_bar_color || barColor,\n    atLineColor = options.at_line_color || lineColor,\n    atPointColor = options.at_point_color || pointColor;\n\n/// for observation choice\nvar observationIds = Object.keys(obsData);\n\n/// set global variables\nvar CLICKED_VARIABLE_NAME = variableNames[0],\n    CLICKED_OBSERVATION_ID = observationIds[0],\n    IS_BUTTON_CLICKED = false;\n\n/// set dimensions\nvar margin = {top: options.margin_top, right: options.margin_right,\n              bottom: options.margin_bottom, left: options.margin_left,\n              inner: options.margin_inner,\n              small: options.margin_small, big: options.margin_big,\n              ytitle: options.margin_ytitle};\n\nvar w = options.w, h = options.h;\n\nvar plotWidth = w + margin.left + margin.right,\n    plotHeight = h + margin.top + margin.bottom;\n\nvar studioMargin = {top: 50, bottom: 50},\n    studioWidth = dim[1]*plotWidth,\n    studioHeight = studioMargin.top + dim[0]*plotHeight + studioMargin.bottom;\n\n/// should subtitle be displayed and plot height be extended\nvar additionalHeight = 0;\nif (!SHOW_SUBTITLE) {\n  additionalHeight = 25;\n  bdSubtitle = null;\n  svSubtitle = null;\n  cpSubtitle = null;\n  fiSubtitle = null;\n  pdSubtitle = null;\n  adSubtitle = null;\n  fdSubtitle = null;\n  tvSubtitle = null;\n  atSubtitle = null;\n}\n\n/// for plot chosing\nvar notVisiblePlots = EDA ?\n                       [{id:\"BD\", text: bdTitle + \" [Local]\"},\n                       {id:\"SV\", text: svTitle + \" [Local]\"},\n                       {id:\"CP\", text: cpTitle + \" [Local]\"},\n                       {id:\"FI\", text: fiTitle + \" [Global]\"},\n                       {id:\"PD\", text: pdTitle + \" [Global]\"},\n                       {id:\"AD\", text: adTitle + \" [Global]\"},\n                       {id:\"FD\", text: fdTitle + \" [EDA]\"},\n                       {id:\"TV\", text: tvTitle + \" [EDA]\"},\n                       {id:\"AT\", text: atTitle + \" [EDA]\"}] :\n                       [{id:\"BD\", text: bdTitle + \" [Local]\"},\n                       {id:\"SV\", text: svTitle + \" [Local]\"},\n                       {id:\"CP\", text: cpTitle + \" [Local]\"},\n                       {id:\"FI\", text: fiTitle + \" [Global]\"},\n                       {id:\"PD\", text: pdTitle + \" [Global]\"},\n                       {id:\"AD\", text: adTitle + \" [Global]\"}];\n\nvar visiblePlots = [];\n\n/// generate facet x,y coordinates with grid index\nvar facetData = [], id = 0;\nfor (let i = 0; i < dim[0]; i++) {\n  for (let j = 0; j < dim[1]; j++) {\n    facetData.push({x: 0 + j*plotWidth,\n                    y: studioMargin.top + i*plotHeight,\n                    index: id});\n    id++;\n  }\n}\n\n///:\\\\\\\ninitializeStudio();\n///:\\\\\\\n\nfunction initializeStudio() {\n  /// this function initializes modelStudio (used only once, at start)\n\n  // top decorations\n  var TOP_G = svg.append(\"g\")\n                 .attr(\"class\", \"TOP_G\");\n\n  TOP_G.append(\"text\")\n       .attr(\"class\", \"mainTitle\")\n       .attr(\"x\", 15)\n       .attr(\"y\", 30)\n       .text(msTitle);\n\n  TOP_G.append(\"line\")\n       .attr(\"class\", \"mainLine\")\n       .attr(\"x1\", 10)\n       .attr(\"x2\", studioWidth - 10)\n       .attr(\"y1\", studioMargin.top - margin.big)\n       .attr(\"y2\", studioMargin.top - margin.big);\n\n  ///:\\\\\\ add select observation input\n  let tempW = calculateTextWidth(dropDownData.map(e => e.text))*1.6 + 18; // 15px bold 600\n\n  // center the ms\n  d3.select(\"#\" + WIDGET_ID)\n    .style('position', 'absolute')\n    .style('left', 0)\n    .style('right', 0)\n    .style('margin', 'auto');\n\n  var input = d3.select(\"#\" + WIDGET_ID)\n                .append(\"select\")\n                .attr(\"id\",\"input\")\n                .style(\"position\", \"absolute\") // to make input appear on top\n                .style(\"left\", (studioWidth - margin.big - tempW)+\"px\")\n                .style(\"top\", -studioHeight + 180)\n                .style(\"font-size\", \"15px\")\n                .style(\"font-weight\", 600)\n                .style(\"color\", \"#371ea3\");\n\n  input.selectAll()\n       .data(dropDownData)\n       .enter()\n       .append(\"option\")\n       .attr(\"value\", d => d.id)\n       .text(d => d.text)\n       .style(\"font-size\", \"15px\")\n       .style(\"font-weight\", 600)\n       .style(\"color\", \"#371ea3\");\n\n  input.on(\"change\", function() {\n\n    // update observation specific plots\n    updatePlots(event = \"observationChange\",\n                variableName = null,\n                observationId = this.value,\n                plotId = null);\n  });\n  ///:\\\\\\\n\n  // bottom decorations\n  var BOTTOM_G = svg.append(\"g\")\n                    .attr(\"class\", \"BOTTOM_G\");\n\n  BOTTOM_G.append(\"text\")\n          .attr(\"class\", \"footerTitle\")\n          .attr(\"x\", studioWidth - 15 - getTextWidth(footerText, 12, 'Fira Sans, sans-serif'))\n          .attr(\"y\", studioHeight - studioMargin.bottom + 25)\n          .text(footerText);\n\n  BOTTOM_G.append(\"line\")\n          .attr(\"class\", \"footerLine\")\n          .attr(\"x1\", 10)\n          .attr(\"x2\", studioWidth - 10)\n          .attr(\"y1\", studioHeight - studioMargin.bottom + margin.big)\n          .attr(\"y2\", studioHeight - studioMargin.bottom + margin.big);\n\n  // middle buttons\n  var MIDDLE_G = svg.append(\"g\")\n                    .attr(\"class\", \"MIDDLE_G\");\n\n  var enterChoiceButtons = MIDDLE_G.selectAll()\n                                   .data(facetData)\n                                   .enter()\n                                   .append(\"rect\")\n                                   .attr(\"class\", \"enterChoiceButton\")\n                                   .attr(\"id\", (d,i) => \"enterChoiceButton\"+i)\n                                   .attr(\"width\", plotWidth)\n                                   .attr(\"height\", plotHeight)\n                                   .attr(\"x\", d => d.x)\n                                   .attr(\"y\", d => d.y);\n\n  // add `+` to buttons\n  MIDDLE_G.selectAll()\n          .data(facetData)\n          .enter()\n          .append(\"line\")\n          .attr(\"class\", \"mainLine\")\n          .attr(\"id\", (d,i) => \"enterChoiceButton\"+i)\n          .attr(\"x1\", d => d.x + plotWidth/2)\n          .attr(\"x2\", d => d.x + plotWidth/2)\n          .attr(\"y1\", d => d.y + plotHeight/2 - margin.big)\n          .attr(\"y2\", d => d.y + plotHeight/2 + margin.big);\n\n  MIDDLE_G.selectAll()\n          .data(facetData)\n          .enter()\n          .append(\"line\")\n          .attr(\"class\", \"mainLine\")\n          .attr(\"id\", (d,i) => \"enterChoiceButton\"+i)\n          .attr(\"x1\", d => d.x + plotWidth/2 - margin.big)\n          .attr(\"x2\", d => d.x + plotWidth/2 + margin.big)\n          .attr(\"y1\", d => d.y + plotHeight/2)\n          .attr(\"y2\", d => d.y + plotHeight/2);\n\n  // events\n  enterChoiceButtons.on('mouseover', function() { d3.select(this).style(\"opacity\", 1);})\n                    .on('mouseout', function() { d3.select(this).style(\"opacity\", 0.5);})\n                    .on(\"click\", function(d,i) {\n\n                      // block other buttons\n                      if (!IS_BUTTON_CLICKED) {\n                        IS_BUTTON_CLICKED = true;\n                        // allow for plot choice or exit choice\n                        showChoiceButtons(this, i);\n                      }\n                    });\n\n  var exitChoiceButtons = MIDDLE_G.selectAll()\n                                  .data(facetData)\n                                  .enter()\n                                  .append(\"rect\")\n                                  .attr(\"class\", \"exitChoiceButton\")\n                                  .attr(\"id\", (d,i) => \"exitChoiceButton\"+i)\n                                  .attr(\"width\", plotWidth - margin.big)\n                                  .attr(\"height\", plotHeight - margin.big)\n                                  .attr(\"x\", d => d.x + margin.small)\n                                  .attr(\"y\", d => d.y + margin.small)\n                                  .style(\"visibility\", \"hidden\");\n\n  // events\n  exitChoiceButtons.on(\"click\", function(d,i) {\n\n                     // delete chosePlotButtons\n                     svg.select(\"#chosePlotButton\"+i).remove();\n                     // hide this button\n                     svg.select(\"#exitChoiceButton\"+i).style(\"visibility\", \"hidden\");\n                     // show enterChoiceButton\n                     svg.selectAll(\"#enterChoiceButton\"+i).style(\"visibility\", \"visible\");\n                     // let the user click other buttons\n                     IS_BUTTON_CLICKED = false;\n                   });\n\n  var exitPlotButtons = MIDDLE_G.selectAll()\n                                .data(facetData)\n                                .enter()\n                                .append(\"g\")\n                                .attr(\"id\", (d,i) => \"exitPlotButton\"+i)\n                                .attr(\"transform\", d => \"translate(\" +\n                                (d.x + margin.left + w - 2*margin.big) + \",\" +\n                                (d.y + margin.small) + \")\")\n                                .style(\"visibility\", \"hidden\");\n\n  exitPlotButtons.append(\"rect\")\n                 .attr(\"class\", \"descriptionBox\")\n                 .attr(\"width\", 2*margin.big)\n                 .attr(\"height\", 2*margin.big)\n                 .attr(\"rx\", 2*margin.big)\n                 .attr(\"ry\", 2*margin.big);\n\n  exitPlotButtons.append(\"text\")\n                 .attr(\"class\", \"descriptionLabel\")\n                 .attr(\"dy\", \"1.05em\")\n                 .attr(\"x\", 6)\n                 .text(\"X\");\n\n  // events\n  exitPlotButtons.selectAll(\"*\")\n                 .on(\"mouseover\", function() { d3.select(this).style(\"cursor\", \"pointer\");})\n                 .on(\"mouseout\", function() { d3.select(this).style(\"cursor\", \"auto\");})\n                 .on(\"click\", function(d) {\n\n                   let j = d.index;\n                   // available only when no enterPlotButton clicked\n                   if (!IS_BUTTON_CLICKED) {\n                     // which plot is in this place?\n                     let temp = visiblePlots.filter(el => el.index == j)[0];\n                     // add this plot to not visible\n                     notVisiblePlots.push({text: temp.text, id: temp.id});\n                     // delete this plot from visible\n                     visiblePlots = visiblePlots.filter(el => el.id !== temp.id);\n                     // hide this button\n                     svg.select(\"#exitPlotButton\"+j).style(\"visibility\", \"hidden\");\n                     // hide plot\n                     svg.select(\"#\"+temp.id)\n                        .style(\"visibility\", \"hidden\");\n                     // show enterChoiceButton\n                     svg.selectAll(\"#enterChoiceButton\"+j).style(\"visibility\", \"visible\");\n                   }\n                 });\n\n  function showChoiceButtons(object, j) {\n    /// chosePlotButtons controller\n\n    // hide this button\n    svg.selectAll(\"#enterChoiceButton\"+j).style(\"visibility\", \"hidden\");\n    // show exitChoiceButton\n    svg.select(\"#exitChoiceButton\"+j).style(\"visibility\", \"visible\");\n\n    // where to place text?\n    let plotWidth = parseFloat(d3.select(object).attr(\"width\")),\n        plotHeight = parseFloat(d3.select(object).attr(\"height\")),\n        x = parseFloat(d3.select(object).attr(\"x\")),\n        y = parseFloat(d3.select(object).attr(\"y\"));\n\n    let chosePlotButtons = MIDDLE_G.append(\"g\")\n                                   .attr(\"id\",\"chosePlotButton\"+j);\n\n    chosePlotButtons.selectAll()\n             .data(notVisiblePlots)\n             .enter()\n             .append(\"text\")\n             .attr(\"class\", \"bigTitle\")\n             .attr(\"id\", d => d.id)\n             .attr(\"x\", x + plotWidth/2)\n             .attr(\"y\", (d,i) => y + plotHeight/2 + 25*i - (notVisiblePlots.length/2)*25)\n             .attr(\"text-anchor\", \"middle\")\n             .text(d => d.text)\n             .on(\"mouseover\", function() { d3.select(this).style(\"cursor\", \"pointer\");})\n             .on(\"mouseout\", function() { d3.select(this).style(\"cursor\", \"auto\");})\n             .on(\"click\", function(d) {\n\n               // when clicking on text, hide exitChoiceButton\n               svg.selectAll(\"#exitChoiceButton\"+j).style(\"visibility\", \"hidden\");\n               // delete chosePlotButtons\n               svg.select(\"#chosePlotButton\"+j).remove();\n               // add this plot to visible\n               visiblePlots.push({text: d.text, id: this.id, index: j });\n               // delete this plot from not visible\n               notVisiblePlots = notVisiblePlots.filter(el => el.id !== this.id);\n\n               updatePlots(event = \"chosePlot\",\n                           variableName = null,\n                           observationId = null,\n                           plotId = this.id);\n\n               // show plot and move it to the right place\n               // margin.big added because translate 0 is -10\n               svg.select(\"#\"+this.id)\n                  .attr(\"transform\",\"translate(\" + (x) + \",\" + (y + 1.5*margin.big) + \")\")\n                  .style(\"visibility\", \"visible\");\n\n               // make exit button visible\n               svg.select(\"#exitPlotButton\"+j).style(\"visibility\", \"visible\");\n\n               // let the user click other buttons\n               IS_BUTTON_CLICKED = false;\n             });\n  }\n\n  if (facetData.length >= 1) {\n    svg.selectAll('.enterChoiceButton').filter('#enterChoiceButton0').dispatch('click');\n    svg.select(\"#chosePlotButton0\").select(\"#BD\").dispatch('click');\n  }\n\n  if (facetData.length >= 2) {\n    svg.selectAll('.enterChoiceButton').filter('#enterChoiceButton1').dispatch('click');\n  }\n}\n};","style":"/* R2D3 Source File:   */\ntext {\n  font-family:'Fira Sans';\n  font-style:normal;\n  fill: #371ea3;\n  -webkit-user-select: none;\n  -moz-user-select: none;\n  -ms-user-select: none;\n  -o-user-select: none;\n  user-select: none;\n}\n\n.bigTitle {\n  font-family:'Fira Sans';\n  font-style:normal;\n  font-weight: 700;\n  font-size: 18px;\n  text-align: left;\n}\n\n.smallTitle {\n  font-family:'Fira Sans';\n  font-style:normal;\n  font-weight: 700;\n  font-size: 13px;\n  text-align: left;\n}\n\n.axisTitle {\n  font-family:'Fira Sans';\n  font-style:normal;\n  font-weight: 700;\n  font-size: 13px;\n  text-align: center;\n}\n\n.axisLabel {\n  font-family:'Fira Sans';\n  font-style:normal;\n  font-weight: 500;\n  font-size: 11px;\n}\n\n.axisLabel .domain {\n    stroke: #371ea3;\n}\n\n.legendTitle {\n  font-family:'Fira Sans';\n  font-style: normal;\n  font-weight: 500;\n  font-size: 13px;\n  text-align: left;\n}\n\n.legendLabel {\n  font-family:'Fira Sans';\n  font-style: normal;\n  font-weight: 500;\n  font-size: 11px;\n  text-align: left;\n}\n\n.legendBox {\n  fill: #ceced9;\n  op
